//create a function that returns a tab item component
import React from 'react';

const TabItem = ({method,content}) => {
    return (
       <div >
         <div className="method">{method}</div>
         <div className="content">{content}</div>
         <div>Tab Item</div>
       </div>
    );
}

export default TabItem;
